			counter = 0; // מאפס משתנים למקרה שבסוף משחק השחקן לחץ על הכפתור שחקו שוב
			minutes = 0; // מאפס משתנים למקרה שבסוף משחק השחקן לחץ על הכפתור שחקו שוב
			seconds = 0; // מאפס משתנים למקרה שבסוף משחק השחקן לחץ על הכפתור שחקו שוב
			notPlaying = 0 // מאפס משתנים למקרה שבסוף משחק השחקן לחץ על הכפתור שחקו שוב
		
