			//totalMistakes
			countMissedTrue = 0; // מאפס משתנים למקרה שבסוף משחק השחקן לחץ על הכפתור שחקו שוב
			countCatchFalse = 0;// מאפס משתנים למקרה שבסוף משחק השחקן לחץ על הכפתור שחקו שוב
			totalMistakes = 0; // מאפס משתנים למקרה שבסוף משחק השחקן לחץ על הכפתור שחקו שוב
